const data_namespaceObject = JSON.parse('{"p":[{"title":"Generative Trivia","desc":["A generative trivia website built with Next.js, Firebase, NextAuth, Google OAuth, and TypeScript. Users can generate trivia questions for predefined school subjects and answer them with a unique interactive input style. The application supports user authentication with Google and stores data in Firestore.","The project is a culmination of my passion for web development and my desire to create a fun and interactive learning platform. The website is designed to be user-friendly and engaging, with a clean and modern interface that appeals to a wide audience. The trivia questions are generated using the Gemini API, which provides a diverse range of questions for users to answer."],"year":"2023","preview":"https://generative-trivia.vercel.app/","code":"https://github.com/Alvalens/generative-trivia","images":["/projects/trivia/trivia1.png","/projects/trivia/trivia2.png","/projects/trivia/trivia3.png"],"tech":["NextJS","Shadcn UI","Tailwind CSS","Firebase","Gemini API"],"slug":"trivia"},{"title":"Saku Senyum","desc":["Saku Senyum is a website that I created as a Fullstack Developer in PT Hafdzahmedia based on client request. The website is a sales management for UMKM or small business. The website is built using Next.js, TypeScript, Tailwind CSS, ShadCN UI, Prisma, and MySQL.","The website has a few features such as a dashboard for the user to manage their business sales, a statistic page, and a sales report page. User can see their sales performance in a fancy chart to make it easier to understand. The user also can export their sales report to a PDF file which can be printed or saved to their device."],"year":"2024","images":["/projects/saku-senyum/saku-senyum1.png","/projects/saku-senyum/saku-senyum2.png","/projects/saku-senyum/saku-senyum3.png","/projects/saku-senyum/saku-senyum4.png"],"tech":["NextJS","Typescript","Shadcn UI","Tailwind CSS","Prisma","MySQL"],"slug":"saku-senyum"},{"title":"LUDOang","desc":["LUDOang is a game that my team and I created for a final project in my university. The game is built python, pygame, and OpenGL. The game is a 2D game that is inspired by a Ludo game. The game has a few features such randomZone, and a 3D dice.","RandomZone is a feature that allows the player to get a random number of steps. The 3D dice is a feature that allows the player to roll a 3D dice. The game also has a few other features menuy screen and also loading screen.","Beside that the game also has a audio theme that will play when the game is started. The game also has a few sound effects such as dice roll sound, and a sound when the player win the game."],"year":"2023","preview":"https://github.com/Alvalens/ludo-game/releases/tag/pre-release","code":"https://github.com/Alvalens/ludo-game","images":["/projects/LUDOang/ludo1.png","/projects/LUDOang/ludo2.png","/projects/LUDOang/ludo3.png"],"tech":["Python","Pygame","OpenGL"],"slug":"ludoang"},{"title":"React Realtime Chat","desc":["My ambitious project that delves into the world of interactive web development using React. This project is a realtime chat application that allows users to create chat rooms and chat with other users in realtime. The application is built using React, Firebase, and Daisy UI.","This project is my second react project and my first project using Firebase. I learned a lot about how to use Firebase and how to use React to create a realtime application. I also learned how to use Daisy UI, a CSS framework that is built on top of Tailwind CSS. "],"year":"2023","preview":"https://react-chat-rouge.vercel.app","code":"https://github.com/Alvalens/react-realtime-chat","images":["/projects/chat/chat1.png","/projects/chat/chat2.png","/projects/chat/chat3.png","/projects/chat/chat4.png"],"tech":["JavaScript","React","React Router","Firebase","Daisy UI"],"slug":"react-chat"},{"title":"React Tools","desc":["React Tools is a groundbreaking and user-friendly project that brings together a comprehensive collection of tools and components crafted with cutting-edge technologies, including React, React Router, and TailwindCSS. What sets this project apart is that it\'s not just a suite of powerful features, but it\'s also a significant milestone as it marks my very first venture into the world of React development.","Unlike traditional web applications, React Tools cleverly utilizes browser local storage, eliminating the need for external databases. This not only ensures seamless performance but also prioritizes user data privacy. ","The Todo List keeps tasks in check with intuitive task management capabilities, ensuring you never miss a beat. The note-taking feature provides a hassle-free way to jot down ideas and crucial information, accessible whenever inspiration strikes. Additionally, our robust expense tracker simplifies financial management by recording and categorizing expenses, delivering insightful spending analysis."],"year":"2023","preview":"https://react-tools-flax.vercel.app","code":"https://github.com/Alvalens/react-tools","images":["/projects/tools/tools.png","/projects/tools/tools1.png","/projects/tools/tools2.png","/projects/tools/tools3.png"],"tech":["Javascript","React","React Router","TailwindCSS"],"slug":"react-tools"},{"title":"Aleph Discord Bot","desc":["Aleph is a Discord bot that I created for my dircord server to use. The bot is built using Python and the discord.py library. The bot has image grabber feauture that takes argument (keywords) and returns an image from the internet.","Other than that this bot has a few other features such as utility command to delete a messages, and a command to get the server\'s ping. This bot is still in development and I plan to add more features in the future."],"year":"2023","preview":"","code":"https://github.com/Alvalens/aleph-discord-bot","images":["/projects/bot/bot1.png","/projects/bot/bot2.png"],"tech":["Python","Discord.py","Google Serp API"],"slug":"aleph-discord-bot"},{"title":"LPTK Cup 2023 Website","desc":["LPTK Cup UM is a website that I created for a competition held by  the Universitas Negeri Malang. The website is mainly built using Laravel and Bootstrap. The website has a few features such as a registration form, a login system, article system, file upload,  and a dashboard for the admin to manage the contents.","This project is my second freelance project, this project is not as big as my first freelance project but I learned a lot from this project. I learn how to manage a project and how to work with a team."],"year":"2023","preview":"","code":"","images":["/projects/lptk/lptk1.png","/projects/lptk/lptk2.png","/projects/lptk/lptk3.png","/projects/lptk/lptk4.png"],"tech":["PHP","Laravel","Bootstrap","MySQL","jQuery","DataTables"],"slug":"lptk-cup-2023"},{"title":"NU INO Website","desc":["My first freelance project. This project is a website for a School based on a JALAKAR curriculum. The website is built mainly using Laravel and Bootstrap.","This website is LMS like system, have a user management, user auth, quiz and material for student and FAQ","In this project I learned how to work with a team and how to manage a project. I also learned new library such as livewire and alpine.js."],"year":"2023","preview":"","code":"","images":["/projects/ino/ino1.png","/projects/ino/ino2.png","/projects/ino/ino3.png"],"tech":["PHP","Laravel","Bootstrap","Livewire","MySQL","jQuery","DataTables"],"slug":"nu-ino-website"}]}');
